const Intro = () => {
  return (
    <div className=''>
      <h1>인트로</h1>
      <p>당신이 먹는 생수, 수질 검사 통과 했는지 알고 드시나요?</p>
      <p>
        국내 생수 브랜드는 40가지가 넘지만, 생수 제조원은 6개밖에 되지 않아요!
      </p>
    </div>
  );
};

export default Intro;
